var View = require("view42");

var Mod5View = module.exports = View.BarBox.extend({
	name: "Mod5View",
	bar: function(){
		var mod = this.parent.parent;
		View.Icon("cube");
		View(mod.name).css("flex-grow", 1);
		View(mod.constructor.name);
		View(mod.id);
		View("{object}");
	},
	box: function(){
		console.log("box.render", this.parent.parent);
		var mod = this.parent.parent;
		for (var i in mod.props){
			console.log(i, mod.props[i]);
			mod.props[i].render()
		}
	}
});